import * as actiontype from './Action'

export const ACTION_LOAD_USERS={
    type:actiontype.LOAD_USERS,
    payload:{
        users:undefined
    }
}

export const ACTION_UPDATE_USER={
    type:actiontype.UPDATE_USERS,
    payload:{
        user:undefined
    }
}
